import React from "react"

function Exercise(props){
    return(
            <div className={props.className}>
                <h2>{props.title}</h2>
                <p>{props.para}</p>
                <button href={props.href} className={props.btnClassName}>{props.btnValue}</button>
            </div>
    )
}


export default Exercise
